import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, question, questions, questionId, id,props }){

    const q = (id) => getQuestionId(id);



    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>  
                <p>{q.title}</p>
                <p>{question.title}</p>


        </Paper>
    )
}

export default Question;
